import { Sidebar, Menu, MenuItem } from 'react-pro-sidebar';
import { Link, useLocation } from 'react-router-dom';

const Sidebars = () => {
    const loc = useLocation()
    return (
        <Sidebar>
            <Menu>
                <MenuItem active={loc} component={<Link to={'/user/dashboard'} />}> Home </MenuItem>
                <MenuItem component={<Link to={'/user/add-contacts'} />}> Add Contacts </MenuItem>
                <MenuItem component={<Link to={'/user/show-contacts'} />}> View Contacts </MenuItem>
                <MenuItem component={<Link to={'/user/profile'} />}> Profile </MenuItem>
                <MenuItem component={<Link to={'/user/settings'} />}> Settings </MenuItem>
            </Menu>
        </Sidebar>
    )
}

export default Sidebars
